import React from 'react';
import ReactDOM from 'react-dom';
import { Form, Button, Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function validateEmail(email) {
  const re = /^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|(".+"))@gmail.com$/;
  return re.test(email);
}

function validatePhone(phone) {
  const re = /^9[0-9]{9}$/;
  return re.test(phone);
}

function Contacto() {
  const [nombre, setNombre] = React.useState('');
  const [email, setEmail] = React.useState('');
  const [telefono, setTelefono] = React.useState('');
  const [emailError, setEmailError] = React.useState('');
  const [telefonoError, setTelefonoError] = React.useState('');
  const [isFormValid, setIsFormValid] = React.useState(false); // Flag para controlar el envío del formulario

  const handleNombreChange = (event) => {
    setNombre(event.target.value);
  };

  const handleEmailChange = (event) => {
    const emailValue = event.target.value;
    const isValidEmail = validateEmail(emailValue);
    setEmail(emailValue);
    setEmailError(isValidEmail ? '' : 'Ingrese un correo electrónico válido (solo @gmail.com)');
    setIsFormValid(isValidEmail && telefonoError === ''); // Actualizar la bandera solo si ambos campos son válidos
  };

  const handleTelefonoChange = (event) => {
    const phoneValue = event.target.value;
    const isValidPhone = validatePhone(phoneValue);
    setTelefono(phoneValue);
    setTelefonoError(isValidPhone ? '' : 'Ingrese un número de teléfono válido (10 dígitos empezando por 9)');
    setIsFormValid(emailError === '' && isValidPhone); // Actualizar la bandera solo si ambos campos son válidos
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    if (isFormValid) {
      // Realizar la solicitud POST al servidor backend
      fetch('http://localhost:3000/guardar-contacto', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ nombre, email, telefono }),
      })
      .then(response => response.json())
      .then(data => {
        // Manejar la respuesta del servidor
        console.log('Success:', data);
        // Aquí puedes redirigir al usuario o mostrar un mensaje de éxito
      })
      .catch((error) => {
        // Manejar errores de la solicitud
        console.error('Error:', error);
      });
    } else {
      alert('Por favor corrija los errores en el formulario para enviar.');
    }
  };

  return (
    <div className="Contacto">
      <Container className="mt-4">
        <h1 className="text-center">Contacto</h1>
        <p className="text-center">Ingresa tus datos</p>
      </Container>
      <Container className="mt-4">
        <Row>
          <Col md={{ span: 8, offset: 2 }}>
            <Form onSubmit={handleSubmit}>
              <Form.Group className="mb-3" controlId="nombre">
                <Form.Label>Nombre</Form.Label>
                <Form.Control type="text" placeholder="Ingresa tu nombre completo" required value={nombre} onChange={handleNombreChange} />
              </Form.Group>
              <Form.Group className="mb-3" controlId="email">
                <Form.Label>Dirección de correo electrónico</Form.Label>
                <Form.Control type="email" placeholder="Ingresa tu dirección de correo electrónico" required value={email} onChange={handleEmailChange} />
                {emailError && <p className="text-danger">{emailError}</p>}
              </Form.Group>
              <Form.Group className="mb-3" controlId="telefono">
                <Form.Label>Teléfono</Form.Label>
                <Form.Control type="text" placeholder="Ingresa tu número de teléfono" required value={telefono} onChange={handleTelefonoChange} />
                {telefonoError && <p className="text-danger">{telefonoError}</p>}
              </Form.Group>
              <br></br>
              <Button variant="primary" type="submit" disabled={!isFormValid}>
                Enviar
              </Button>
              <br></br>
              <br></br>
            </Form>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

// Renderizar el componente Contacto en el elemento root del HTML
ReactDOM.render(<Contacto />, document.getElementById('root'));

export default Contacto;
